  `order_id` int(11) NOT NULL,
  `amount` decimal(20,2) NOT NULL,
  `product_type` int(11) NOT NULL,
  `product_id` int(11) NOT NULL,
  KEY `order_id` (`order_id`),
  CONSTRAINT `order_detail_ibfk_1` FOREIGN KEY (`order_id`) REFERENCES `orders` (`id`)
