/*!50003 CREATE*/ /*!50017 DEFINER=`microlabel`@`localhost`*/ /*!50003 trigger insert_order_detail before insert on order_detail for each row
begin
	if (select order_state from orders where id=new.order_id)=1 then
			signal sqlstate '02000' set message_text='order closed';end if;if new.product_type=1 then
		if (select id from songs where id=new.product_id) is null then
			signal sqlstate '02001' set message_text='unknown song';end if;elseif new.product_type=2 then
		if (select id from albums where id=new.product_id) is null then
			signal sqlstate '02002' set message_text='unknown album';end if;elseif new.product_type=3 then
		if (select id from artists where id=product_id) is null then
			signal sqlstate '02003' set message_text='unknown artist';end if;else
		signal sqlstate '02000' set message_text='unknown product type';end if;end */;;
